B.a9_=new A.aS('In dieser Datenschutzerkl\xe4rung informieren wir Sie \xfcber die Verarbeitung personenbezogener Daten bei der Nutzung unserer App "Tech Hub".\n\n1. Verantwortlicher\nDer Verantwortliche f\xfcr die Datenverarbeitung in dieser App ist: [Justyn Kuhne] [K\xe4mpenstr 50, 45147 Essen, Deutschland] [justyn.kuhne@yahoo.de]\n\n2. Erhebung und Speicherung personenbezogener Daten\na) Bei Nutzung der App (Backend: Supabase)\nUnsere App nutzt f\xfcr die Datenbankverwaltung, Authentifizierung und Speicherung von Inhalten den Dienst Supabase (Supabase Inc.). Alle von Ihnen eingegebenen Daten werden direkt an die Server von Supabase \xfcbertragen und dort gespeichert. Dazu geh\xf6ren:\n\u2022 Profil-Daten: E-Mail-Adresse, Benutzername, Profilbilder.\n\u2022 Inhalte: Posts, Bilder und Reels, die Sie hochladen.\n\u2022 Statistiken: Anzahl der Follower und Beitr\xe4ge.\n\u2022 Sicherheit: Ihre Passw\xf6rter werden niemals im Klartext gespeichert. Durch kryptografisches Hashing (bcrypt) im Supabase Auth-System sind Ihre Zugangsdaten gesch\xfctzt.\n\u2022 Datenspeicherung: Mediendateien (Videos/Bilder) werden physisch im Supabase Storage (Objektspeicher) abgelegt, w\xe4hrend die Verweise darauf (URLs) in der PostgreSQL-Datenbank verwaltet werden.\n\u2022 Datenminimierung: Wir setzen technische Verfahren zur Datenminimierung ein, indem wir Videodateien vor dem Upload komprimieren und skalieren. Dies dient der effizienten \xdcbertragung und schont das Datenvolumen der Nutzer.\n\u2022 Automatische Moderation: Um die Qualit\xe4t der Inhalte zu gew\xe4hrleisten, verf\xfcgt das System \xfcber eine automatische Moderationslogik. Beitr\xe4ge, die eine Anzahl von 10 negativen Bewertungen (Dislikes) erreichen, f\xfchren zu einer Verwarnung des Nutzers. Bei Erreichen von 15 negativen Bewertungen wird der entsprechende Inhalt automatisch und unwiderruflich gel\xf6scht.\n\nb) Nutzerverantwortung und Verhaltensregeln\nJeder Nutzer ist f\xfcr die von ihm erstellten und geteilten Inhalte (Texte, Bilder, Reels) vollumf\xe4nglich selbst verantwortlich. Wir legen Wert auf ein respektvolles Miteinander.\n\u2022 Verbotene Inhalte: Es ist streng untersagt, jugendfreie (pornografische), kriminelle, rassistische, diskriminierende, gewaltverherrlichende oder rechtswidrige Inhalte zu ver\xf6ffentlichen.\n\u2022 Sanktionen: Verst\xf6\xdfe gegen diese Regeln werden konsequent geahndet. Wir behalten uns das Recht vor, entsprechende Inhalte ohne Vorank\xfcndigung zu l\xf6schen und das betroffene Benutzerprofil dauerhaft zu sperren.\n\nc) Erstellung von Reels (KI-Generierung via n8n Webhook)\nUnsere App erm\xf6glicht die Erstellung von KI-generierten Lernvideos (Reels). Hierbei werden die von Ihnen gew\xe4hlten Kategorien und Themen per Webhook an einen Automatisierungsdienst (n8n) gesendet.\n\u2022 Zweck: Diese Daten dienen ausschlie\xdflich der automatisierten Videoerstellung durch K\xfcnstliche Intelligenz.\n\u2022 KI-Videogenerierung: Zur Erstellung der Reels werden Thema und Kategorie an OpenAI (Sora) \xfcbermittelt. Eine Verkn\xfcpfung mit Ihrer pers\xf6nlichen Identit\xe4t findet dabei nicht statt.\n\u2022 Verarbeitung: Nach der Generierung wird das Video in der Supabase-Datenbank gespeichert.\n\n3. Weitergabe von Daten\nEine Weitergabe Ihrer pers\xf6nlichen Daten an Dritte erfolgt nicht, au\xdfer:\n\u2022 An unsere Dienstleister (Supabase als Datenbank-Provider), die technisch notwendig f\xfcr den Betrieb der App sind.\n\u2022 Wenn eine gesetzliche Verpflichtung dazu besteht.\n\n4. Speicherdauer\nWir speichern Ihre Daten so lange, wie es f\xfcr die Bereitstellung der Funktionen der App erforderlich ist oder bis Sie Ihr Benutzerkonto l\xf6schen. Nach der L\xf6schung Ihres Kontos werden Ihre Daten aus den aktiven Datenbanken entfernt, sofern keine gesetzlichen Aufbewahrungspflichten bestehen.\n\n5. Ihre Rechte\nSie haben das Recht:\n\u2022 Auskunft \xfcber Ihre bei uns gespeicherten Daten zu erhalten.\n\u2022 Die Berichtigung unrichtiger Daten zu verlangen.\n\u2022 Die L\xf6schung Ihrer Daten zu fordern (Recht auf Vergessenwerden).\n\u2022 Der Verarbeitung Ihrer Daten zu widersprechen.\n\n6. Datensicherheit\nWir setzen technische und organisatorische Sicherheitsma\xdfnahmen ein (z. B. SSL/TLS-Verschl\xfcsselung der \xdcbertragung an Supabase), um Ihre Daten gegen Manipulation, Verlust oder unbefugten Zugriff zu sch\xfctzen.',null,null,null,null,null,null,null,null,null)
